import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';


const OneDoctor = () => {

  const location = useLocation();
  console.log(location.state.name)

  const [appointments, setAppointments] = useState()

  useEffect(()=>{
    axios.get(`http://localhost:5001/appointments/${location.state.id}`).then((response)=>{
      console.log(response.data)
      setAppointments(response.data)
    })
  },[])
  return (

    <div className='OneDoctorDetailsContainer'>
      <h1>Welcome Doctor</h1>
      <div className='OneDoctorDetails'>
        <Card sx={{ maxWidth: 345 }}>
            <CardActionArea>
                <CardContent>
                  <Typography gutterBottom variant="h4" component="div">{location.state.name}</Typography>
                  <Typography variant="h5" color="text.secondary">{location.state.specialization}</Typography>
                </CardContent>
            </CardActionArea>
          </Card>
      </div>
    </div>
